import React from 'react'
import PropTypes from 'prop-types'

class BoxModel extends React.Component {
    static propTypes = {
        imgSrc: PropTypes.string.isRequired,
        title: PropTypes.string.isRequired,
        link: PropTypes.string.isRequired,
        git: PropTypes.string.isRequired,
        override: PropTypes.string
    }

    constructor(props) {
        super(props)
    }

    render() {
        const {
            props: {
                imgSrc,
                title,
                link,
                git,
                override
            }
        } = this

        return (
            <div class="boxmodel">
                <h3 class="boxmodel-title">{ title }</h3>
                <img src={ imgSrc } class="boxmodel-image"></img>
                <div class="boxmodel__links">
                    <div class="boxmodel__links-release"><a href={ link } target="_blank">{ override != null ? override:link }</a></div>
                    <div class="boxmodel__links-develop">Github: <a href={ git } target="_blank"> { git }</a></div>
                </div>
            </div>
        )
    }
}

export default BoxModel
